import React from "react";
import { Route } from "react-router";

export default function PageRoutes() {
  return (
    <Routes>
      <Route path="/" element={<Login />} />
      <Route path="/login" element={<Login />} />
      <Route path="/user" element={<UserProfile />} />
    </Routes>
  );
}
